INSERT INTO `wp_posts` VALUES("206", "1", "2019-01-10 14:31:47", "2019-01-10 14:31:47", "<h2>Layanan Kami</h2>		\n										<img width=\"256\" height=\"256\" src=\"http://localhost:8888/servisac/wp-content/uploads/2018/12/6.png\" alt=\"\" srcset=\"http://localhost:8888/servisac/wp-content/uploads/2018/12/6.png 256w, http://localhost:8888/servisac/wp-content/uploads/2018/12/6-150x150.png 150w\" sizes=\"(max-width: 256px) 100vw, 256px\" />											\n			<h5>Cuci AC</h5>		\n		<p>Lakukan pencucian AC secara berkala agar tetap awet serta membersihkan kotoran pada saringan agar sirkulasi udara lancar</p>		\n										<img width=\"256\" height=\"256\" src=\"http://localhost:8888/servisac/wp-content/uploads/2018/12/6.png\" alt=\"\" srcset=\"http://localhost:8888/servisac/wp-content/uploads/2018/12/6.png 256w, http://localhost:8888/servisac/wp-content/uploads/2018/12/6-150x150.png 150w\" sizes=\"(max-width: 256px) 100vw, 256px\" />											\n			<h5>Reparasi</h5>		\n		<p>Ada beberapa masalah yang akan terjadi dengan AC jika hal tersebut terjadi layanan reparasi siap mengatasinya</p>		\n										<img width=\"256\" height=\"256\" src=\"http://localhost:8888/servisac/wp-content/uploads/2018/12/6.png\" alt=\"\" srcset=\"http://localhost:8888/servisac/wp-content/uploads/2018/12/6.png 256w, http://localhost:8888/servisac/wp-content/uploads/2018/12/6-150x150.png 150w\" sizes=\"(max-width: 256px) 100vw, 256px\" />											\n			<h5>Relokasi</h5>		\n		<p>Jika terjadi renovasi bangunan maka dibutuhkan rellokasi, Kami siap membantu proses pemindahan tersebut</p>		\n										<img width=\"256\" height=\"256\" src=\"http://localhost:8888/servisac/wp-content/uploads/2018/12/6.png\" alt=\"\" srcset=\"http://localhost:8888/servisac/wp-content/uploads/2018/12/6.png 256w, http://localhost:8888/servisac/wp-content/uploads/2018/12/6-150x150.png 150w\" sizes=\"(max-width: 256px) 100vw, 256px\" />											\n			<h5>Pasang Baru</h5>		\n		<p>Percayakan pemasangan/konsultasikan AC Anda kepada Kami yang sudah bekerjasama terhadap berbagai produk AC terbaik</p>		\n			<h2>Support</h2>		\n										<img width=\"300\" height=\"300\" src=\"http://localhost:8888/servisac/wp-content/uploads/2018/12/Copy-of-Logo-FT-06-1-300x300.png\" alt=\"\" srcset=\"http://localhost:8888/servisac/wp-content/uploads/2018/12/Copy-of-Logo-FT-06-1-300x300.png 300w, http://localhost:8888/servisac/wp-content/uploads/2018/12/Copy-of-Logo-FT-06-1-150x150.png 150w, http://localhost:8888/servisac/wp-content/uploads/2018/12/Copy-of-Logo-FT-06-1-768x768.png 768w, http://localhost:8888/servisac/wp-content/uploads/2018/12/Copy-of-Logo-FT-06-1-1024x1024.png 1024w\" sizes=\"(max-width: 300px) 100vw, 300px\" />											\n			<h5>Friendstech</h5>		\n										<img width=\"203\" height=\"249\" src=\"http://localhost:8888/servisac/wp-content/uploads/2019/01/makassar.png\" alt=\"\" />											\n			<h5>Asosiasi Teknisi Refregerasi Dan Tata Udara</h5>		\n										<img width=\"224\" height=\"225\" src=\"http://localhost:8888/servisac/wp-content/uploads/2018/12/asisi.jpeg\" alt=\"\" srcset=\"http://localhost:8888/servisac/wp-content/uploads/2018/12/asisi.jpeg 224w, http://localhost:8888/servisac/wp-content/uploads/2018/12/asisi-150x150.jpeg 150w\" sizes=\"(max-width: 224px) 100vw, 224px\" />											\n			<h5>Pemkot Kota Makassar</h5>", "Home", "", "inherit", "closed", "closed", "", "14-revision-v1", "", "", "2019-01-10 14:31:47", "2019-01-10 14:31:47", "", "14", "http://localhost:8888/servisac/2019/01/10/14-revision-v1/", "0", "revision", "", "0");
